<template>
	<view class="container">
		<view class="head_box text-white">
			<cu-custom :isBack="true">
				<block slot="backText"></block>
				<block slot="content">注册</block>
			</cu-custom>
		</view>
		<!-- 背景图 -->
		<view class="x-c"><image class="head-img" :src="userInfo.avatarUrl || '/static/imgs/base_avatar.png'" mode="aspectFill"></image></view>
		<!-- titleview -->
		<view class="wrapper padding-top">
			<!-- logo -->
			<!-- 表单 -->
			<view class="login-box y-f">
				<view class="input-item x-c">
					<text class="inp-title">昵&emsp;称</text>
					<input class="inp" disabled v-model="userInfo.username" type="text" placeholder-class="pl" />
				</view>
				<view class="input-item x-c">
					<text class="inp-title">手机号</text>
					<input class="inp" disabled v-model="userInfo.phoneNumber" type="number" placeholder-class="pl" />
				</view>
				<view class="tip-box" @tap="onTcp">
					<label class="x-f">
						<radio class="tcp-radio brown" :class="{ checked: isTcp }" :checked="isTcp"></radio>
						<view class="">
							我已阅读并遵守
							<text class="tcp" @tap="jump('/pages/public/richtext', { type: 1 })">《用户协议》</text>
						</view>
					</label>
				</view>
			</view>
			<!-- 登录按钮 -->
			<view class="x-c y-f"><button class="cu-btn login-btn" @tap="register">立即注册</button></view>
		</view>
	</view>
</template>

<script>
import { mapMutations, mapActions, mapState } from 'vuex';

export default {
	data() {
		return {
			WechatId: '',
			PublicOpenID: '',
			isTcp: false, //协议
			sysInfo: uni.getStorageSync('sysInfo')
		};
	},
	computed: {
		...mapState({
			userInfo: state => state.user.userInfo,
			storeInfo: state => state.user.storeInfo,
			balInfo: state => state.user.balInfo
		})
	},
	onLoad(option) {
		if (JSON.stringify(option) != '{}') {
			this.WechatId = option.WechatId;
			this.PublicOpenID = option.PublicOpenID;
			this.getZkUserInfo()
		}
	},
	methods: {
		...mapActions(['getUserBalance','getUserDetails']),
		jump(path, parmas) {
			this.$Router.push({
				path: path,
				query: parmas
			});
		},
		getZkUserInfo(){
			let that = this;
			this.$api('user.balance2', {
				WechatId: that.WechatId,
				PublicOpenID: that.PublicOpenID,
				placeId: that.storeInfo.v8PlaceId,
				V8Url: that.storeInfo.v8Url,
			}).then(res => {
				if (res.flag) {
					uni.showToast({
						title: '成功获取信息',
						icon: 'none',
						duration: 1000,
						mask: true,
					});
				}
			});
		},
		async register() {
			let that = this;
			if (this.isTcp) {
				/* let string = 'WechatId:'+that.WechatId+',PublicOpenID:'+that.PublicOpenID+',phone:'+that.userInfo.phoneNumber+',photo:'+that.userInfo.avatarUrl+',name:'+that.userInfo.username+',sex:'+that.userInfo.sex
				uni.setClipboardData({
					data: string, //要被复制的内容
					success: function() {
						//重点~做笔记
						//在success中加入uni.hideToast()可以解决
						uni.hideToast({
							title: '复制成功',
							duration: 2000,
							icon: 'none'
						});
						//以下就可自定义操作了~
					},
					fail: function(err) {
						uni.showToast({
							title: '复制失败',
							duration: 2000,
							icon: 'none'
						});
					}
				}); */
				this.$api('user.createMember', {
					WechatId: that.WechatId,
					PublicOpenID: that.PublicOpenID,
					phone: that.userInfo.phoneNumber,
					photo: that.userInfo.avatarUrl,
					name: that.userInfo.username,
					placeId: that.storeInfo.v8PlaceId,
					V8Url: that.storeInfo.v8Url,
					sex: that.userInfo.sex
				}).then(res => {
					if (res.flag) {
						let msgData = JSON.parse(res.data);
						if(msgData.success){
							that.getUserDetails();
							uni.showToast({
								title: msgData.MsgText || '注册成功',
								icon: 'success',
								duration: 2000,
								mask: true,
								success: function() {
									setTimeout(function() {
										that.$Router.back();
									}, 2000);
								}
							});
						}else{
							that.$tools.toast(msgData.MsgText);
						}
					}
				});
			} else {
				this.$tools.toast('请先同意协议！');
			}
		},
		onTcp() {
			this.isTcp = !this.isTcp;
		}
	}
};
</script>

